          if (parent === 'RuntimeComponent') {
              result.init = 'init';
              result.destroy = 'destroy';
              result.error = 'error';
          } else {
              schemaDef = _getSchemaDef(parent, schemas);

              for (propName in schemaDef) {
                  if (propName.indexOf('_') !== 0) {
