function open(url, target, isExt) {
    var ref = null,
        that = this;

    function _getRelativePath() {
      var result = 'index.html';

      switch (that.context()) {
        case 'system':
          if (that.system()) {
            result = result + '#' + that.system().id() + '#system#' + that.system().name();
          }
          break;
        case 'schemas':
          if (that.system()) {
            result = result + '#' + that.system().id() + '#schemas';
            if (that.space()) {
             result = result + '#' + that.space();
            }
          }
          break;
        case 'models':
          if (that.system()) {
            result = result + '#' + that.system().id() + '#models';
            if (that.space()) {
             result = result + '#' + that.space();
            }
          }
          break;
        case 'types':
          if (that.system()) {
            result = result + '#' + that.system().id() + '#types';
            if (that.space()) {
             result = result + '#' + that.space();
            }
          }
          break;
        case 'behaviors':
          if (that.system()) {
            result = result + '#' + that.system().id() + '#behaviors';
            if (that.space()) {
             result = result + '#' + that.space();
            }
          }
          break;
        case 'components':
          if (that.system()) {
            result = result + '#' + that.system().id() + '#components';
            if (that.space()) {
             result = result + '#' + that.space();
            }
          }
          break;
        case 'logs':
          if (that.system()) {
            result = result + '#' + that.system().id() + '#logs';
          }
          break;
        default:
          break;
      }

      return result;
    }

    switch(true) {
      case this.isElectron():
        if (isExt) {
            ref = require('electron').shell.openExternal(url, target);  
        } else {
            if (target === '_self') {
              window.location.href = url;
            } else {
              ref = window.open(url, target);
            }
        }
        break;
      case this.isCordova():
        if (isExt) {
          window.open(url, '_system');
        } else { 
          if (url.indexOf('index.html') === -1) {
            var system = this.require('db').collections().System.find({
                '_id': this.require('designer').system().id()
            })[0];
            system = JSON.parse(JSON.stringify(system));
            delete system.classInfo;

            url = url + '?system=' + encodeURIComponent(JSON.stringify(system));
            url = url + '&ref=' + encodeURIComponent(_getRelativePath());
          }
          document.location.href = url;
        }
        break;
      default:
        ref = window.open(url, target);
        break;
    }

    return ref;
}

